import "./App.scss";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="app">
      <div className="app--header">
        <Link to="/"></Link>
      </div>
      <Route></Route>
    </div>
  );
}

export default App;
